import styled from "../assets/styles";
import { theme } from '../assets/styles/mainStyles';

export const Header = styled.header`
    display: flex;
    align-items: center;
    justify-content: space-around;
    h1 {
        font-family: Montserrat;
        font-style: normal;
        font-weight: 800;
        font-size: 48px;
        color: ${theme.colors.primary};


    }
    h3 {
        color: white;
        /* width: 194px;
        height: 21px; */
    }

`
